?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">История этой компании тесно переплетается с другой часовой компанией, а именно с Dr. Girard Schild. В середине 19 века Шильд и Жирард основали эту самую компанию, которая в 1906 году поменяла свое название. В 1914 году была представлена, совершенно немыслимая по тем годам, модель наручных часов с будильником. После выпуска этих часов, компания Eterna стала популярной во всем мире. Начиная с 1930 года, компания наладила серийное производство одних из самых маленьких наручных часов. В последующие десятилетия, компания Eterna радовала часовую общественность своими новыми разработками. А в день своего столетия, компания представила новую линейку сверхтонких часов. На данный момент часы марки Eterna это хронографы, модели как с кварцевым механизмом, так и с автоподзаводом. Все модели изготовлены в своем неповторимом стиле. Их отличает стальной корпус, золотое или серебряное покрытие, антибликовые сапфировые стекла и кожаный ремешок. Модели Eterna это швейцарская классика, которая соединила в себе современные технологии и традиции швейцарского часоделия.</span></span></p>
 
